     <BrowserRouter>
    <AuthProvider>
      <Routes>
      <Route path="/dashboard" element={<Main/> }>
            <Route index element={<Main />}/>
          </Route>
      </Routes>
    </AuthProvider>

     </BrowserRouter>
    </div>
  );
}

export default App;
